export function fetchCharacters() {
  return {
    type: 'FETCH_CARACHTERS_START',
  };
}

export function filterCharactersStart(searchText) {
    return {
      type: 'FILTER_CARACHTERS_START',
      payload: searchText,
    };
  }

  export function fetchCharactersSuccess(characters) {
    return {
      type: 'FETCH_CARACHTERS_SUCCESS',
      payload: characters,
    };
  }

  export function fetchCharactersError(characters) {
    return {
      type: 'FETCH_CARACHTERS_ERROR',
      payload:characters,
    };
  }
